import React from 'react';
import ReactTerminal from 'react-terminal-component';
import './terminal.css';

function Terminal() {
    return (
        <div className='Terminal'>
            <ReactTerminal theme={{
                background: '#141313',
                promptSymbolColor: 'gold',
                commandColor: '#77FB00',
                outputColor: '#fcfcfc',
                errorOutputColor: '#ff89bd',
                fontSize: '1.1rem',
                spacing: '1%',
                fontFamily: 'Agency FB'
            }}/>
        </div>
    );
}

export default Terminal;
